function findWords(letters) {
    // regex: /^[abcdefg]*a[abcdefg]*$/
    let regex = new RegExp('^[' + letters + ']*' + letters[0] + '[' + letters + ']*$');
    return words.filter(word => word.match(regex));
}

function solve() {
    let letters = document.getElementById("letters").value.toLowerCase();
    if (!validLetters(letters)) {
        return;
    }
    var words = findWords(letters);
    let isPangram = word => (new Set(word.split('')).size == 7);
    // sort with pangrams first
    words.sort((a,b) => {
        let aIsPangram = isPangram(a);
        let bIsPangram = isPangram(b);

        return aIsPangram !== bIsPangram ? bIsPangram - aIsPangram : a.localeCompare(b);
    });

    let pangrams = new Set(words.filter(isPangram));

    var wordsList = document.createElement("ul");
    for (const word of words) {
        var item = document.createElement("li");
        item.textContent = word;
        if (pangrams.has(word)) {
            item.setAttribute("class", "has-text-weight-bold");
        }
        wordsList.appendChild(item);
    }
    clearWords();
    document.getElementById("words").appendChild(wordsList);
    window.location.hash = '#' + letters.toUpperCase();
}

function clearWords() {
    document.getElementById("words").innerHTML = "";
}

function validLetters(letters) {
    return letters.match(/^[a-z]{7}$/i);
}

function checkForValidInput() {
    if (validLetters(document.getElementById("letters").value)) {
        solve();
    } else {
        clearWords();
    }
}

window.onload = function() {
    let lettersInput = document.getElementById("letters");

    // check for letters in the url
    if (window.location.hash && window.location.hash.length == 8) {
        lettersInput.value = window.location.hash.substring(1);
    }

    lettersInput.addEventListener("input", checkForValidInput);

    checkForValidInput();
};
